import React, { useState } from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { makeStyles } from '@material-ui/styles';
import {
  Card,
  CardHeader,
  CardContent,
  CardActions,
  Button,
  Divider,
  Table,
  TableBody,
  TableRow,
  TableCell,
  colors
} from '@material-ui/core';
import EditIcon from '@material-ui/icons/Edit';
import LockOpenIcon from '@material-ui/icons/LockOpenOutlined';
import PersonIcon from '@material-ui/icons/PersonOutline';

import { Label } from 'components';
import { CustomerEdit, EnrollInProgram } from './components';
import { useEffect } from 'react';

const useStyles = makeStyles(theme => ({
  root: {},
  content: {
    padding: 0
  },
  actions: {
    flexDirection: 'column',
    alignItems: 'flex-start',
    '& > * + *': {
      marginLeft: 0
    }
  },
  buttonIcon: {
    marginRight: theme.spacing(1)
  }
}));

const CustomerInfo = props => {
  const { user, className, ...rest } = props;

  const classes = useStyles();



  const [openEdit, setOpenEdit] = useState(false);

  const [openEnrol, setOpenEnroll] = useState(false);


  console.log('the contactInfo effect  ', user)


  const handleEditOpen = () => {
    setOpenEdit(true);
  };

  const handleEditClose = () => {
    setOpenEdit(false);
  };
  const handleEnroll = () => {
    setOpenEnroll(true);
  };

  const handleEnrollClose = () => {
    setOpenEnroll(false);
  };
  return (
    <Card
      {...rest}
      className={clsx(classes.root, className)}
    >
      <CardHeader title="User Details " />
      <Divider />
      <CardContent className={classes.content}>
        <Table>
          <TableBody>
            <TableRow>
              <TableCell>Status</TableCell>
              <TableCell>
                {user.designation_name}
                <div>
                  <Label
                    color={
                      user[0].user[0].status ? colors.green[600] : colors.orange[600]
                    }
                  >
                    {user[0].user[0].status
                      ? 'Enrolled'
                      : 'No verified'}
                  </Label>
                </div>
              </TableCell>
            </TableRow>
            <TableRow selected>
              <TableCell>Name</TableCell>
              <TableCell>{user[0].user[0].surname } {user[0].user[0].other_names}</TableCell>
            </TableRow>
            <TableRow>
              <TableCell>Gender</TableCell>
              <TableCell>{user[0].user[0].gender }</TableCell>
            </TableRow>
            <TableRow selected>
              <TableCell>Designation</TableCell>
              <TableCell>{user[0].designation_name }</TableCell>
            </TableRow>
            <TableRow>
              <TableCell>Role</TableCell>
              <TableCell>{user[0].level[0].level_name}</TableCell>
            </TableRow>
            <TableRow selected>
              <TableCell>Date Registered</TableCell>
              <TableCell>{user[0].date_created}</TableCell>
            </TableRow>
          </TableBody>
        </Table>
      </CardContent>
      <CardActions className={classes.actions}>
        <Table>
          <TableBody>
            <TableRow selected>
              <TableCell>
                <Button onClick={handleEditOpen}>
                  <EditIcon className={classes.buttonIcon} />
                  Edit Client
                </Button>
              </TableCell>
              <TableCell>
                <Button onClick={handleEditOpen}>
                  <EditIcon className={classes.buttonIcon} />
                  Enroll
                </Button>
              </TableCell>
            </TableRow>            
          </TableBody>
        </Table>

      </CardActions>

      <CustomerEdit
        user={user[0].user[0]}
        onClose={handleEditClose}
        open={openEdit}
      />

      <EnrollInProgram
        user={user[0].user[0]}
        onClose={handleEditClose}
        open={openEdit}
      />
    </Card>
  );
};

CustomerInfo.propTypes = {
  className: PropTypes.string,
  //user: PropTypes.object.isRequired
};

export default CustomerInfo;
